css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("youtube.com") {
  body {
	background-color: #858585 !important;
	color: #000000 !important;
		background-image: url(data:image/jpeg;base64,)!important;
}

	
#yt-masthead-container{
	background: #5F5A54 !important;
	/*background: #5F5A54 !important;*/
	background-image: url(data:image/jpeg;base64,)!important;
	}
	
	#upload-btn{
    background: #CFC779 none repeat scroll 0% 0%!important;
    box-shadow: -0.1em -0.1em 0.05em #B39223 inset!important;
		border-radius: 1px!important;	}
	

	.epic-nav-item-heading {
    background: #CFC779 none repeat scroll 0% 0%!important;
    box-shadow: -0.1em 0.1em 0.05em #B39223 inset!important;
		height: 30px!important;
	  padding-left: 4px!important;
		padding-right: 4px!important;
}

	
	.yt-uix-button-primary,
	.yt-uix-button-primary[disabled],
	.yt-uix-button-primary[disabled]:hover,
	.yt-uix-button-primary[disabled]:active,
	.yt-uix-button-primary[disabled]:focus {
    border-color: #548F0C!important;
    background: #DAC703 none repeat scroll 0% 0%!important;
    color: #000!important;;
}
	
	.yt-uix-button{
		color:#000!important;
		background: #CFC779 none repeat scroll 0% 0%!important;
		box-shadow: -0.1em -0.1em 0.05em #B39223 inset!important;
		border-radius: 1px!important;}		
	
	#masthead-search-terms input {
    background: #BCBFB1  none repeat scroll 0% 0%!important;
		border: 1px solid #F0E68C!important;
}	
	
.gsfe_b{
	border: 1px solid #F0E68C!important;
}	
	
	/*common color*/
.yt-card {
    margin: 0px 0px 10px;
    border: 0px none;
    background: #BCBFB1 none repeat scroll 0% 0%!important;;
    box-shadow: 2px 1px 2px rgba(0, 0, 0, 0.1);
    box-sizing: border-box;
}
	
.autoplay-bar .checkbox-on-off {
color: #000!important;;
}
	
.yt-subscription-button-subscriber-count-branded-horizontal,.yt-subscription-button-subscriber-count-unbranded-horizontal {
	color:#000!important;}
	
.display-message {
	color:#000!important;
}	
	.comments .comment-header .linked-comment {
color:#000!important;
}	
	
	#watch-more-related-loading,
	#watch7-sidebar{
	color:#000!important;
	}
	
	.video-list .video-list-item .description, .video-list .video-list-item .stat {
    color: #000!important;
}
	
	.video-list-item a:hover {
		background: rgba(56, 27, 32, 0.2)!important;
}	
	
	.video-list .video-list-item .title {
	color: #000!important;
}
	.yt-subscription-button-subscriber-count-branded-horizontal, .yt-subscription-button-subscriber-count-unbranded-horizontal {
	background-color: #719B48!important;
}	
#footer{
	background: #BCBFB1!important;
}	
	body #footer-container {
	background-color: #BCBFB1!important;
}	
#appbar-guide-menu, .guide-flyout {
	background: #BCBFB1 none repeat scroll 0% 0%!important;
}
#watch-appbar-playlist,
.watch-playlist{
	background: #BCBFB1!important;
	color:#000!important;
}	
	
	
.yt-lockup-title a,
.yt-lockup:hover a,
.yt-lockup:hover .yt-lockup-meta a,
.yt-lockup:hover .yt-lockup-description a,
.yt-lockup,
.yt-lockup .yt-lockup-meta a,
.yt-lockup .yt-lockup-description a,
.yt-lockup .yt-lockup-byline a,
.comments a{
	color: #000!important;
}	
.yt-badge {
	border: 1px solid #F0E68C!important;
	color: #000!important;
	background: #CFC779 repeat scroll 0% 0%!important;
	box-shadow: -0.1em -0.1em 0.05em #B39223 inset!important;
}	
	.yt-badge:hover {
	background: #B39223 none repeat scroll 0% 0%!important;
	box-shadow: -0.1em -0.1em 0.05em #CFC779 inset!important;
}	
	
.video-player-view-component .description{
	background: #BCBFB1!important;
}
#player-playlist .radio-playlist .playlist-videos-list,
.playlist-video-description,
.yt-ui-ellipsis, .yt-ui-ellipsis-2,
li.yt-uix-scroller-scroll-unit,
li.yt-uix-scroller-scroll-unit:hover,
.playlist-title{
background: #BCBFB1!important;
color:#000!important;
}	
#appbar-nav .yt-uix-button.yt-uix-button-epic-nav-item {
margin-left: 10px!important;
}	
	
	#appbar-nav .yt-uix-button.yt-uix-button-epic-nav-item {
	padding-left: 3px!important;
	padding-right: 3px!important;
line-height: 10px!important;
		height: 30px!important;
	border: 1px solid #F0E68C!important;
}
.all-comments,
.all-comments a,
.yt-simplebox-text{
background:#BCBFB1!important;
color:#000!important;
}
.box{
background:#BCBFB1!important;
}
.share{
color:#000!important;
}	
.yt-simplebox-text:focus {
    border-color: rgb(240, 230, 140)!important;;
    box-shadow: 0px 0px 1px rgba(0, 0, 0, 0.1) inset!important;;
}
.yt-simplebox-arrow{
display:none!important;}

.comments .like-count,
.comments .comment-footer-action {
    color: rgb(29, 67, 31)!important;
}
#action-panel-details a:hover,
#action-panel-details a {
    color: rgb(240, 230, 140)!important;
}
#watch8-sentiment-actions .like-button-renderer .yt-uix-button {
    padding-right: 10px!important;
}
.like-button-renderer-like-button:active .yt-uix-button-content, .like-button-renderer-like-button.yt-uix-button-toggled .yt-uix-button-content {
    color: rgb(0, 0, 0)!important;
}
.video-extras-sparkbar-likes {
background: none repeat scroll 0% 0% rgb(240, 230, 140)!important;
}

.html5-play-progress, .ytp-play-progress {
   background: #F0E68C !important; 
}
.html5-scrubber-button:hover, .ytp-scrubber-button:hover, .ytp-swatch-background-color, .ytp-swatch-background-color-secondary {
   background: #F0E68C !important;
}
.ytp-volume-slider-track {
   background: #F0E68C !important;
}
}
